INSERT INTO `imgrecords` VALUES (1299, 'http://localhost:9999/files/6d39964e95e44114a0172772a004a9a9_algal_spot_20211227_133008.jpg', 'http://localhost:9999/files/f9986f46e5a24bcda553ddd1d392f14f_result.jpg', '[\"96.23%\"]', '0.169秒', 0.50, 'best copy.pt', '1111', '2025-07-22 12:39:49', '[\"\\u85fb\\u6591\\u75c5\"]', 'DeepSeek', '### 藻斑病（Algal Leaf Spot）分析与建议  \n\n#### **1. 病害成因**  \n- **病原体**：由寄生性藻类（如Cephaleuros属）引起，潮湿环境下易滋生。  \n- **环境条件**：高温高湿（雨季多发）、通风不良、茶园荫蔽过度、土壤排水差。  \n- **管理因素**：氮肥过量导致叶片柔嫩，茶树密度过高，修剪不及时。  \n\n#### **2. 种植建议**  \n- **改善通风**：合理修剪茶树（疏除过密枝、病枝），保持株距，避免荫蔽。  \n- **水分管理**：确保排水通畅，避免积水；喷灌改为滴灌，减少叶片湿润时间。  \n- **平衡施肥**：减少氮肥用量，增施磷钾肥（如草木灰）增强抗病性。  \n- **清洁茶园**：及时清除病叶、落叶，减少病原体残留。  \n\n#### **3. 治疗措施**  \n- **生物防治**：喷施1%波尔多液（硫酸铜+石灰）或0.3%碳酸氢钠溶液。  \n- **化学防治**：严重时选用铜基杀菌剂（如氢氧化铜），按说明间隔7-10天喷施2-3次。  \n- **增强树势**：叶面喷施海藻酸或微量元素肥，促进叶片角质层形成。  \n\n#### **4. 预防重点**  \n- 雨季前喷施保护性杀菌剂（如代森锰锌）。  \n- 定期监测叶片背面（藻斑初期为灰绿色绒状斑点，后变红褐色）。  \n\n（注：避免在高温时段喷药，以防药害。）');
