INSERT INTO `leafgraderecords` VALUES (3, 'http://localhost:9999/files/dac3ff8649ba4e89b0dcd54f25b9e928_IMG_20231226_144526_jpg.rf.883905599b5a726f31734aea379d3140.jpg', 'http://localhost:9999/files/53fdcf07ddb74d95a02938fa9ce799ee_result.jpg', '[\"86.77%\"]', '3.267秒', 0.50, 'leafage.pt', 'admin', '2025-07-22 12:36:45', '[\"2-4\\u5929\"]', 'DeepSeek', '根据您的检测结果（叶龄 **2-4天**），以下是茶叶的评级信息、特点及用途分析：\n\n---\n\n### **1. 茶叶评级信息**\n- **叶龄分类**：2-4天  \n- **对应评级**：**特级或一级茶**（具体取决于茶类）  \n  - 这类嫩叶通常用于制作高品质茶叶（如绿茶、白茶、高级红茶等），因芽叶柔嫩、内含物质丰富，市场价值较高。\n\n---\n\n### **2. 特点分析**\n- **外观**：叶片半展开或初展，颜色鲜绿/嫩黄，叶质柔软，可能带有芽头。  \n- **内含物质**：  \n  - **高氨基酸**：鲜爽甘甜的口感（如茶氨酸）。  \n  - **适中茶多酚**：涩味较低，适合轻发酵或不发酵茶。  \n  - **丰富芳香物质**：花香、嫩香明显。  \n- **缺点**：产量较低，需精细采摘，耐泡度略逊于老叶。\n\n---\n\n### **3. 推荐用途**\n- **适合茶类**：  \n  - **绿茶**（如龙井、碧螺春）：突出鲜爽口感。  \n  - **白茶**（白牡丹、银针）：自然萎凋保留嫩叶清香。  \n  - **高级红茶**（金骏眉）：蜜香浓郁。  \n- **冲泡建议**：低温（80-85℃）、快速出汤，避免闷泡导致苦涩。  \n\n---\n\n### **其他叶龄的对比参考**\n| 叶龄      | 评级          | 特点                          | 用途                  |\n|-----------|---------------|-----------------------------|-----------------------|\n| 1-2天     | 顶级（芽头）  | 芽头为主，极致鲜嫩，产量极少 | 名优绿茶、白茶银针    |\n| **2-4天** | **特级/一级** | 嫩叶为主，鲜爽度高           | 高端绿茶、白茶、红茶  |\n| 4-7天     | 二级/三级     | 叶片成熟，滋味浓强           | 乌龙茶、大宗红茶      |\n| 7+天      | 次级/原料茶   | 叶质粗硬，苦涩明显           | 黑茶、茶包原料        |\n\n---\n\n### **建议**\n若您的茶叶检测结果为 **2-4天**，可优先考虑制作 **高附加值茶类**（如高端绿茶或白茶），并通过轻发酵工艺最大化鲜味。如需进一步优化评级，可结合叶片完整度、病虫害情况等指标综合判断。');
INSERT INTO `leafgraderecords` VALUES (4, 'http://localhost:9999/files/98f49ed36f494044a1f04aa24b58bda7_IMG_20231226_145953_jpg.rf.5868255f279c4b61e9e376dec0382ac2.jpg', 'http://localhost:9999/files/f1dfccde8e1847ffb8c1f79ad4d494b9_result.jpg', '[\"91.57%\"]', '3.657秒', 0.50, 'leafage.pt', '1111', '2025-07-22 13:21:17', '[\"4-7\\u5929\"]', 'DeepSeek', '根据您的检测结果（叶龄4-7天），以下是详细的茶叶评级信息及对应的特点与用途分析：\n\n---\n\n### **1. 茶叶评级信息**\n- **等级**：中等偏上级（适合商业级或优质口粮茶）  \n- **常见茶类应用**：乌龙茶（如铁观音）、红茶（如工夫红茶）、中档绿茶等  \n- **市场定位**：日常饮用茶、中端商品茶的主流原料  \n\n---\n\n### **2. 4-7天叶龄茶叶的特点**\n| 特征        | 具体表现                                                                 |\n|-------------|--------------------------------------------------------------------------|\n| **外观**    | 叶片半展开至完全展开，颜色深绿或黄绿（取决于品种），叶面较平整，边缘可能有轻微锯齿 |\n| **质地**    | 柔韧性较好，介于嫩叶与老叶之间，茎部开始木质化但未完全硬化               |\n| **内含物质** | 茶多酚、咖啡碱含量适中，氨基酸略低于嫩叶，芳香物质（如橙花叔醇）开始积累 |\n| **口感**    | 平衡感强：鲜爽度稍弱于嫩叶，但滋味更浓郁，耐泡性提升，轻微涩感可能显现   |\n\n---\n\n### **3. 推荐加工方式与用途**\n- **最佳工艺**：  \n  - **发酵茶类**（红茶、乌龙茶）：叶龄提供足够的物质基础，发酵后能产生果香或蜜香。  \n  - **炒青绿茶**：适合制作香气高扬的茶品（如龙井二级原料）。  \n  - **压制茶**（白茶寿眉、普洱茶）：4-7天叶龄可增加茶汤的层次感。  \n\n- **不适合场景**：  \n  - 顶级明前绿茶（需1-2天嫩芽）、  \n  - 嫩芽白茶（如白毫银针）。  \n\n---\n\n### **4. 各叶龄段对比参考表**\n| 叶龄    | 等级       | 典型用途                     | 优势                          | 局限性                     |\n|---------|------------|------------------------------|-------------------------------|----------------------------|\n| 1-2天   | 特级       | 高端绿茶、白茶银针           | 鲜甜度高，毫香明显            | 产量低，成本高             |\n| 2-4天   | 高级       | 毛峰、碧螺春、金骏眉         | 鲜爽与滋味平衡                | 耐泡性一般                 |\n| **4-7天** | **中上级** | 铁观音、滇红、寿眉           | **性价比高，风味浓郁**        | 涩感需工艺调控             |\n| 7+天    | 普通级     | 黑茶原料、袋泡茶             | 粗纤维丰富，适合陈化          | 青草气重，需渥堆/重发酵    |\n\n---\n\n### **5. 后续建议**\n- **工艺优化**：若用于绿茶，建议缩短杀青时间以避免涩感；用于乌龙茶则可适度做青促进香气转化。  \n- **商业价值**：该叶龄茶叶适合作为茶企的批量生产原料，平衡品质与成本。  \n\n如需进一步分析其他叶龄或特定茶类的适配性，可提供更多细节为您定制方案。');
